import React from 'react';
import { TradingViewWidget } from 'react-tradingview-widget';

const Tokens = () => {
  return (
    <div>
      <h1>Empty Page</h1>
      <TradingViewWidget
        symbol="BINANCE:BTCUSDT,BINANCE:ETHUSDT,CRYPTOCAP:USDT,CRYPTOCAP:USDC,CRYPTOCAP:ADA,CRYPTOCAP:MATIC,CRYPTOCAP:SOL,CRYPTOCAP:BNB,BINANCE:ARBUSDT,CRYPTOCAP:AAVE,CRYPTOCAP:UNI"
        theme="light"
        locale="en"
        width="100%"
        height={500}
      />
    </div>
  );
};

export default Tokens;
